--Troca a senha do usuario
UPDATE tb_usuario SET senha = md5(:senhaNova) WHERE login = :username AND senha = md5(:senha)

--Desativa o usuario(delete logico)
UPDATE tb_usuario SET ativo = 0 WHERE login = :username AND senha=md5(:senha)

--Logando o usuario
SELECT login, senha FROM tb_usuario WHERE tb_usuario.login = :user AND tb_usuario.senha = md5(:senha) AND tb_usuario.ativo = 1 

--Edita a peça
UPDATE tb_item SET qtd_estoque = :quantidade, item = :nomeItem, imagem = :img  , ativo = 1, descricao = :descricao WHERE id_item=:id

--Deleta peça(delete logico)
UPDATE tb_item SET ativo = 0 WHERE id_item = :id

--Acha peça por categoria
SELECT FROM tb_item ti INNER JOIN td_categoria tc ON ti.td_categoria_id_categoria = tc.id_categoria WHERE  tc.id_categoria = :id AND ti.ativo = 1

--Lista categorias
SELECT * FROM td_categoria

--Acha peça por id
SELECT FROM tb_item ti INNER JOIN td_categoria tc ON ti.td_categoria_id_categoria = tc.id_categoria WHERE ti.id_item = :idItem AND ti.ativo = 1 AND tb_usuario.login = :username

